import React from "react";
import {useDispatch} from "react-redux";
import {InputLetter} from "../redux/actions/InputLetter";
import (InputLetter)
function Key(props){

    const dispatch = useDispatch();
    return(
        <div className="key" onclick={()=>dispatch(InputLetter(props.vl))}>
            {props.vl}

        </div>
    );
}

export default Key;
